import React from 'react';
import {connect} from 'react-redux';

class BotaoEntrar extends React.Component {

    render() {
        const { buttonEnter ,email } =this.props;
        return (
            <button disabled={email.length !== 0 ? '' : 'disabled'} onClick={buttonEnter} type="button">Entrar</button>
        )
    }
}

const mapStateToProps = (state) => ({
    email:state.user.email
})

export default connect()(BotaoEntrar);
